	<script>
		//moveset
		let y,
			x,
			grab;
		const event = (event, func) => window.addEventListener(event, func);

		event('mousedown', (e) => {
			y = e.pageY;
			x = e.pageX;
			grab = true;
		})
		event('mousemove', (e) => {
			if (grab) {
				window.scrollBy(x - e.pageX, y - e.pageY)
			}
		})
		event('mouseup', (e) => {
			grab = false;
		})

		//zoom
		const map = document.querySelector('.map');
		let size,
			wheel = 1;

		event('wheel', (e) => {
			// wheel += e.deltaY;
			wheel = wheel + (wheel * .1);
			size = map.clientWidth;
			
			setInterval(() => {
				map.style.transform = `scale(${wheel})`;
			}, 500)
		})
	</script>
